import Navbar from '../components/layout/Navbar'
import Footer from '../components//layoutFooter'

const Contact = () =>(  
      <div>
        <Navbar/>
            <div className="home-image">
                <div className="dark-overlay">
                </div>
            </div>
        <Footer/>
    </div>
    );



export default Contact;
